import axios from 'axios';


export default function TelaList() {
  const [matches, setMatches] = useState([])
  useEffect(() =>{
    getMatches()
  }, [matches])

  const getMatches = () => {
    axios
      .get(
        "https://us-central1-missao-newton.cloudfunctions.net/astroMatch/nastia/matches",

      )
      .then(res => {
       console.log(res.data.matches);
       setMatches(res.data)

      })
      .catch(err => {
        console.log(err.response.data);
      })

  };
  const render =matches.map((match)=>{
    return(
      <div key={match.id}>
        <img src={match.photo} alt={match.name} />
        <p>{match.name}</p>
      </div>
    )
  })

  return (
    <>

    {render}

    </>
  )
}
